import React from 'react'
import {NavLink} from 'react-router-dom'

const NavigationItem = (props) => {
    return(
        <NavLink 
            to={props.link} 
            exact={props.exact} 
            style={
                {textDecoration: 'none',
                color: '#ffeb3b'}
                }
                color={'#fff'}>

            {props.children}
        </NavLink>
    )
}

export default NavigationItem
